import React from 'react'
import {BrowserRouter, Route, Link} from "react-router-dom";



class ManagerNav extends React.Component {
    render() {
        return (
            <BrowserRouter>
            <div className="navbar">
                <div className="ui left fixed vertical menu">
                    <div className="item">

                    </div>
                    <nav>
                        <Link to="/manager" className="nav-item nav-link" style={{fontSize:"20px"}}>manager</Link>
                        <Link to="/hr" className="nav-item nav-link" style={{fontSize:"20px"}}>HR</Link>
                        <Link to="/manager" className="nav-item nav-link" style={{fontSize:"20px"}}>feedback</Link>
                        <Link to="/hr" className="nav-item nav-link" style={{fontSize:"20px"}}>goal</Link>
                    </nav>
                </div>
            </div>
            </BrowserRouter>
        )
    }
}
export default  ManagerNav
